func takeCharactersF(s string, k int) int {
	// a -> 1 b -> 2 c -> 3
	charCount := make([]int, 3)

	// charList := make([]rune, len(s))

	check := make(chan struct{})
	go func(signal chan struct{}) {
		for {
			select {
			case <-signal:
				i := 0
				for _, v := range charCount {

					// 检查是否通过
					if v < k {
						break
					} else {
						i++
					}

					if i == 3 {
						//succeed
					}
				}
			}
		}

	}(check)

	idxL := 0
	idxR := len(s) - 1
	for idxL != idxR {
		charCount[s[idxL]-'a']++
		idxL++
		charCount[s[idxR]-'a']++
		idxR--
	}

	return 0
}
